import React from "react";

const SearchBox = (props) => {
    const { handleSubmit } = props;
    const submit = (values) => {}
    return (
        <>
        <form onSubmit={handleSubmit(submit)}>
            <input></input>
        </form>
        </>
    )
}

export default SearchBox;
